import React from 'react';
import '../App.css';

function Navbar() {
  return (
    <div className="Navbar">
      <h3>LOGO</h3 >

      <ul className="Links">
          <li>Home</li>
          <li>About</li>
          <li>Contact</li>
      </ul>
    </div>
  );
}

export default Navbar;
